import logo from './logo.svg';
import './App.css';
import {
  FormControl,
  FormLabel,
  FormErrorMessage,
  FormHelperText,
} from '@chakra-ui/react'

function App() {
  return (
    <div className="App">
      <FormControl>
        <FormLabel>Add Sundae</FormLabel>
        <FormHelperText>Here is some other text</FormHelperText>
      </FormControl>
    </div>
  );
}

export default App;
